	(508, 'ACCOUNTS_FUNDING_LISTITEM1', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'Losses can exceed initial amount invested.', 'Las prdidas pueden exceder el monto incial invertido.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:51', '2019-01-25 21:14:54'),
	(509, 'ACCOUNTS_FUNDING_LISTITEM2', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'Third party payments will <strong>NOT</strong> be accepted. All deposits <strong>MUST</strong> be from the original account owner.', 'Los depsitos de terceros <strong> NO</strong> sern aceptados. Todos los depsitos debe realizarlos el dueo de la cuenta.', 'Tradeview', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:14:58', '2019-01-25 21:15:02'),
	(510, 'ACCOUNTS_FUNDING_LISTITEM3', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'The trading platform\'s denomination is in USD.', 'La denominacin de las plataformas de trading es el dlar americano.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:05', '2019-01-25 21:15:08'),
	(511, 'ACCOUNTS_FUNDING_LISTITEM4', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', 'TVF reserves the right to bookback/refund any deposits made via Credit Card in lieu of a withdrawal.', 'TVF se reserva el derecho de devolver/reembolsar depsitos realizados con tarjetas de crdito en lugar de realizar un retiro.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:12', '2019-01-25 21:15:15'),
	(512, 'ACCOUNTS_FUNDING_NOTICE', 'TEXT', '["33", "1033", "2033", "3033", "4033", "5033", "6033", "7033", "8033", "9033"]', '<h3 class="display-5 text-primary">IMPORTANT NOTICE:</h3>\r\n<p class="lead"><strong>Be advised</strong>, for all credit card deposits, you are required to take a selfie picture of yourself holding your id/passport. once we have received your verification of identity form we will be able to process your transaction.</p>', '<h3 class="display-5 text-primary">AVISO IMPORTANTE:</h3>\r\n<p class="lead">Se informa que para todos los depsitos por tarjeta de crdito se requiere una foto de usted sosteniendo su identificacin/pasaporte. Una vez que hayamos recibido su formato de Verificacin de Identidad, podremos procesar su transaccin.</p>', '<h3 class="display-5 text-primary">:</h3>\r\n<p class="lead"></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-25 21:15:18', '2019-01-25 21:15:22'),
