	(2010, 'MAIL_TAKE_PHOTO_SUBJECT', 'MAIL', '["0"]', 'Please, verify your identity to process your transaction', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-31 10:05:20', '2019-01-31 10:05:22'),
	(2011, 'MAIL_TAKE_PHOTO_SECURITY', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'At Tradeview we take the security of our customers very seriously.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-31 10:05:20', '2019-01-31 10:05:22'),
	(2012, 'MAIL_TAKE_PHOTO_PLEASE_VERIFY', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'Please verify your identity in the next 24 hours or your deposit will be refunded due to concerns we have for the safety and integrity of our Community. Once we have received your Verification of Identity form we will be able to process your transaction.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-31 10:05:20', '2019-01-31 10:05:22'),
	(2013, 'MAIL_TAKE_PHOTO_ADDITIONAL_DEPOSIT', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', '<small>PLEASE NOTE IF THIS IS AN ADDITIONAL DEPOSIT FROM THE SAME CARD AND YOU HAVE ALREADY PROVIDED YOUR CARD DETAILS YOU DO NOT NEED TO RESUBMIT. IF YOU HAVE NOT FUNDED WITHIN THE 6 MONTHS YOU WILL BE REQUIRED TO SUBMIT A NEW VERIFICATION.</small>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-31 10:05:20', '2019-01-31 10:05:22'),
	(2014, 'MAIL_TAKE_PHOTO_BUTTON_VERIFY', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'VERIFY YOUR IDENTITY', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-31 10:05:20', '2019-01-31 10:05:22'),
	(2015, 'MAIL_THANKYOU_DEPOSIT_THANK', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'Thank you for your Deposit', 'Gracias por realizar su deposito', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 14:54:26', '2019-02-01 14:54:04'),
	(2016, 'MAIL_THANKYOU_DEPOSIT_PROCESSED', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'Your deposit will be processed into the next 24 hours by our agents.', 'Tu deposito ser procesado en las proximas 24 horas por uno de nuestros agentes.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 15:33:19', '2019-02-01 15:33:21'),
	(2017, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH01', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'Thank you for your account application and for joining the Tradeview community. We are currently processing your details and will get back to you as soon as possible. ', 'Gracias por tu aplicacin de cuenta y por unirte a la comunidad de Tradeview. Actualmente estamos procesando tus documentos y daremos respuesta tan pronto como sea posible.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:15:41', '2019-02-01 20:15:44'),
	(2018, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH02', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'To help speed up this process, <strong>please make sure that you enclosed a clear full scan of your passport or photo driving license and a proof of your address</strong> to match that in your application (dated within the last 90 days). If you did not do this you can still send it on to your account manager or<a href="mailto:tradeview@tradeviewforex.com" style="color: #ff0000;"> tradeview@tradeviewforex.com.</a>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:28:58', '2019-02-01 20:29:04'),
	(2019, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH03', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'If you have stated that you earn less than $25,000 a year you will be asked to sign an <strong>Additional Risk Disclosure</strong> form which you can complete <a href="https://www.tradeviewforex.com/downloadable-forms.php" target="_blank" style="color: #ff0000;"> here</a> and send on to us also.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:29:08', '2019-02-01 20:29:12'),
	(2020, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH04', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', '<strong>The application usually gets processed within 24 hours</strong> of receipt during a working week and if everything is correct and present then you will be contacted shortly after that with your new account details. ', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:43:43', '2019-02-01 20:43:47'),
	(2021, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH05', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'If you wish to fund your account during this time then please <a href="https://www.tradeviewforex.com/account-funding.php" target="_blank" style="color: #ff0000;">visit our funding page here</a> for our various options (using your registered email address as reference) as this may also take around 24 hours to process the first payment and can help enable you to get trading as soon as the account is opened.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:52:45', '2019-02-01 20:52:51'),
	(2022, 'MAIL_THANKYOU_DOCUNDERREVIEW_PARAGRAPH06', 'MAIL', '["700", "1700", "2700", "3700", "4700", "5700", "6700", "7700", "8700", "9700"]', 'Please reach out to your account manager for any help you may need at this point and we look forward having you a customer.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-01 20:56:10', '2019-02-01 20:56:15'),
