	(4014, 'FXRESOURCES_CFD_WHY_PARAGRAPH01', 'TEXT', '["0"]', '<p>TradeView Forex offers immediate access to trading tools:</p>\r\n	        <ul class="list-dot font-weight-light">\r\n	            <li>Prices on stocks</li>\r\n	            <li>Sectors</li>\r\n	            <li>Indices</li>\r\n	            <li>Currencies</li>\r\n	            <li>Commodities and Interest rates</li>\r\n	        </ul>\r\n	        <p> It doesn\'t matter where and how you want to trade: we offer online and mobile trading services that keep you ready for the next trade. Our team of experts, dealers and customer service specialists are always available to provide support to each customer. </p>\r\n	        <p> TVF provides spreads and margins for every platform to ensure accurate, competitive information, fair prices and flawless execution for CFD trading. </p>\r\n	        <ul class="list-dot font-weight-light">\r\n	            <li>Streaming tradeable prices through our platforms allow you to act in real time on the very latest price movements.</li>\r\n	            <li>Our prices track the underlying instruments effectively so you know that your trade will result in your expected profit (or loss).</li>\r\n	            <li>No matter if the market is volatile, we will continue to offer fair prices and to make our best to provide the market access you need to open and close positions whenever you want to.</li>\r\n	        </ul>\r\n	        <h4 class="text-muted">These are the products we offer though our Tradeview Forex platforms:</h4>\r\n	        <p><strong>EQUITIES</strong></p>\r\n	        <p> Trade CFDs on thousands and thousands of individual equities listed worldwide. Unlike traditional equity investing, you can choose to go long or short. The choice is yours. </p>\r\n	        <p><strong>STOCK INDICES</strong></p>\r\n	        <p> Choose CFDs on overall stock indices all over the world for a broader view. Some of the markets we trade in are: UK 100, Wall Street, US TECH 100, Japan 225 and the Germany 30. </p>\r\n	        <p> <strong>CURRENCIES</strong> </p>\r\n	        <p> Currency trading at Tradeview Forex CFDs offers access to about 24 currency pairs. </p>\r\n	        <p><strong>PRECIOUS METALS AND COMMODITIES</strong></p>\r\n	        <p> CFDs also offer a straight-to-the-point and affordable way to trade the price movements of commodities that are popular (such as gold, silver and oil). Also, we offer CFDs on the principal commodities markets including coffee, sugar, pork bellies and wheat. </p>', '<p>Tradeview Forex tiene ofertas de acceso inmediato a las herramientas Trade:</p>\r\n	        <ul class="list-dot font-weight-light">\r\n	            <li>Precios en accioness</li>\r\n	            <li>Sectores</li>\r\n	            <li>Indices</li>\r\n	            <li>Monedas</li>\r\n	            <li>Commodities y tasas de inters</li>\r\n	        </ul>\r\n	        <p> No importa en que lugar o a que hora quiera transar: le ofrecemos servicios trading en lnea y mviles, los cuales pueden ayudarle a estar listo para su prxima operacin trading. Nuestro experto equipo de distribuidores, y especialistas en servicio al cliente estn siempre disponibles para proveerle el soporte necesario. </p>\r\n	        <p> TVF proporciona spreads y excedentes para cada Plataforma, garantas exactas, informacin competitiva, precios justos y ejecuciones perfectas para CFD Trading. </p>\r\n	        <ul class="list-dot font-weight-light">\r\n	            <li>Transmisin de precios transables por medio de nuestras increbles plataformas que le permitirn actuar en tiempo real sobre los ms recientes movimientos de los precios.</li>\r\n	            <li>Nuestros precios hacen seguimientos efectivos, no tiene que preocuparse su operacin Trading dar lugar a la ganancia esperada (o prdida).</li>\r\n	            <li>No importa si el mercado es voltil, nosotros continuaremos ofrecindole precios justos y proveyndole el acceso al mercado que usted necesita para abrir y cerrar posiciones cuando lo desee.</li>\r\n	        </ul>\r\n	        <h4 class="text-muted">Estos son los productos que le ofrecemos a travs de nuestras plataformas Tradeview Forex:</h4>\r\n	        <p><strong>Acciones</strong></p>\r\n	        <p> Miles y miles de acciones individuales CFD aparecen listadas alrededor del mundo. Si no desea invertir en acciones de la forma tradicional, puede elegir ir de una inversin larga a una corta, la eleccin es solo suya. </p>\r\n	        <p><strong>Indices de Existencia</strong></p>\r\n	        <p> Elegir CFDs de ndices totales de diferentes partes del mundo otorga una vista ms amplia. Algunos de los mercados que transamos son: REINO UNIDO 100, WALL STREET, US TECH 100, JAPON 225 y ALEMANIA 30. </p>\r\n	        <p> <strong>Monedas</strong> </p>\r\n	        <p> Transar monedas en Tradeview Forex CFDs le ofrece acceso a ms de 24 pares de divisas. </p>\r\n	        <p><strong>Metales preciosos y Commodities</strong></p>\r\n	        <p> CFDs le ofrece tambin una forma asequible y directa. </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 17:59:40', '2019-02-07 17:59:45'),
	(4015, 'FXRESOURCES_CFD_INFO_WHATARE', 'TEXT', '["0"]', 'WHAT ARE CFDs?', 'QUE SON CFDs?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 19:25:07', '2019-02-07 19:25:10'),
	(4017, 'FXRESOURCES_CFD_INFO_PARAGRAPH01', 'TEXT', '["0"]', '<p>\r\n		        A contract for difference (also known as CFD) is a contract between two parties: buyer and seller, specifying that \r\n		        the seller will pay to the buyer the difference between the current value of an asset and its value at contract time. \r\n		    </p>\r\n\r\n		    <p>\r\n		        However, if the difference happens to be a negative one, then the buyer pays to the seller instead. For example, \r\n		        when applied to equities, this kind of contract is an equity derivative that allows investors to speculate on share \r\n		        price movements, without the need for ownership of the underlying shares.\r\n		    </p>\r\n\r\n		    <p>\r\n		        CFDs give investors the chance to take long or short positions. CFDs have no fixed expiry date or contract size, \r\n		        unlike futures contracts,. Trades are conducted on a leveraged basis with margins typically ranging from 1% to 20% \r\n		        of the notional value for CFDs on leading equities.\r\n		    </p>', '<p>\r\n		        Un contrato por diferencia (tambin conocido como CFD) es un contrato entre 2 (dos) partes: comprador y vendedor, especificando que el vendedor pagar al comprador la diferencia entre el valor actual del activo y su valor en el momento del contrato. \r\n		    </p>\r\n\r\n		    <p>\r\n		       Sin embargo si sucede que la diferencia es negativa, entonces el comprador le pagar al vendedor en cambio. Por ejemplo, cuando se aplica a las acciones, este tipo de contrato es una accin derivada que permite a los inversores especular sobre el movimiento de los precios, sin necesidad de la propiedad de las acciones subyacentes.\r\n		    </p>\r\n\r\n		    <p>\r\n		        CFDs brinda a los inversores la oportunidad de tomar posiciones largas o cortas. Los CFDs no tienen fecha fija de vencimiento o tamao de cotrato, a diferencia de los contratos de futuros. Las operaciones Trading se llevan a cabo en una base de apalancamiento con excedentes que por lo general van del 1% al 20% del valor nacional de CFDs sobre acciones lderes.\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 19:50:20', '2019-02-07 19:50:23'),
	(4018, 'FXRESOURCES_CFD_INFO_WHYCFD', 'TEXT', '["0"]', 'WHY TRADING CFDs?', 'POR QUE TRANSAR CFDs?', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 19:54:32', '2019-02-07 19:54:36'),
	(4019, 'FXRESOURCES_CFD_INFO_PARAGRAPH02', 'TEXT', '["0"]', '<p><strong>LEVERAGE YOUR INVESTMENT POTENTIAL</strong></p>\r\n\r\n		    <p>\r\n		        CFDs are traded on leverage, so it\'s possible to increase your exposure to an underlying asset from the same initial \r\n		        investment.  To open a CFD trade, you need to deposit only a part of the total trade value, usually an amont around \r\n		        1-20 percent, allowing you to take a larger position that would be harder to take if you had to fund it in full.\r\n		    </p>\r\n\r\n		    <p>\r\n		        Leverage is great news if the market moves in the direction that you expect, but it becomes a risk if the market \r\n		        moves against you.\r\n		    </p>\r\n\r\n		    <p><strong>TRADE FINANCIAL MARKETS AROUND THE WORLD</strong></p>\r\n\r\n		    <p>\r\n		        CFD trading gives you access to a broad range of markets that usually are not available to retail investors. It is as \r\n		        easy to trade on the price movement of commodities such as oil or gold as it is to trade an individual equity. CFDs \r\n		        also let you to speculate on whole indices or sectors from one single trade.\r\n		    </p>\r\n\r\n		    <p><strong>PROFIT WHEN MARKETS FALL AS WELL AS RISE</strong></p>\r\n\r\n		    <p>\r\n		        By \'going short\' (that is, selling), you can profit from a falling market as easily as you could profit from a rising \r\n		        market by buying it. If you think that a company or a market will have a loss of value in the short term,then you can \r\n		        use CFDs to sell it now, with the expectation that you can buy it later. However, if the price of your trade moves against \r\n		        you, your position will result in a loss.\r\n		    </p>\r\n\r\n		    <p><strong>HEDGE OTHER INVESTMENTS</strong></p>\r\n\r\n		    <p>\r\n		        Since CFDs offer the possibility of going easily as short as long, they can be used to provide a certain insurance \r\n		        against price falls in a portfolio.  For example, if you have a long-term portfolio that you wish to keep, but you feel \r\n		        that there is a short-term risk to the value of your investments, you could use CFDs to damage-control a short term loss \r\n		        by \'hedging\' your position. If the value of your portfolio falls, then the profit in the CFDs should offset these losses.\r\n		    </p>', '<p><strong>APALANCAMIENTO DEL POTENCIAL DE INVERSION</strong></p>\r\n\r\n		    <p>\r\n		        Los CFDs son transados en apalancamiento, por eso es posible incrementar su exposicin a uno subyacente de la misma inversin inicial. Para abrir CFDs para transar es necesario depositar solo una parte del valor total de trading, usualmente un monto alrededor de 1  20 % que le permitir adoptar una posicin mayor, que sera ms difcil de tomar si se tuviera que financiar en su totalidad.\r\n		    </p>\r\n\r\n		    <p>\r\n		       El apalancamiento es una buena noticia si el mercado se mueve en la direccin en que usted lo espera, pero se puede convertir en un riesgo si el mercado se mueve en contra de lo esperado.\r\n		    </p>\r\n\r\n		    <p><strong>MERCADOS FINANCIEROS TRADE AL REDEDOR DEL MUNDO</strong></p>\r\n\r\n		    <p>\r\n		        CFD trading gives you access to a broad range of markets that usually are not available to retail investors. It is as \r\n		        easy to trade on the price movement of commodities such as oil or gold as it is to trade an individual equity. CFDs \r\n		        also let you to speculate on whole indices or sectors from one single trade.\r\n		    </p>\r\n\r\n		    <p><strong>BENEFICIOS CUANDO EL MERCADO DECAE O ASCIENDE</strong></p>\r\n\r\n		    <p>\r\n		        Usted puede beneficiarse de un mercado descendente tanto como podra hacerlo de uno ascendente mediante la compra. Si piensa que una compaa o un mercado tendrn una prdida del valor en un corto plazo entonces puede usar CFDs para vender ahora, con la expectativa de que podr comprar ms tarde. Sin embargo, si el precio de la operacin se mueve en su contra, su posicin resultar en una prdida.\r\n		    </p>\r\n\r\n		    <p><strong>COBERTURA DE OTRAS INVERSIONES</strong></p>\r\n\r\n		    <p>\r\n		        CFDs ofrece la posibilidad de ir fcilmente de posiciones largas o cortas que se pueden utilizar para proporcionar cierto seguro contra cadas en los precios de cartera. Por ejemplo, si usted tiene una cartera a largo plazo que desea mantener pero considera que hay un riesgo a corto plazo para el valor de su inversin.\r\n		    </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-02-07 20:01:19', '2019-02-07 20:01:26'),
